import React, { Component } from 'react';
import '../css/frontend.css';

class Notification extends Component{
    render(){
        return(
            <div>
                <div class="col-md-4 col-lg-4"><div class="panel panel-default"><div class="panel-heading"><h3 class="panel-title">Notifications</h3></div><div class="panel-body"><div class="alert alert-success"> <strong class="default"><i class="fa fa-road"></i> Well done,</strong> You have finished job! <button type="button" class="close" data-dismiss="alert" aria-hidden="true">×</button></div><div class="alert alert-info"> <strong class="default"><i class="fa fa-user"></i> John</strong> sent you friend request. <button type="button" class="close" data-dismiss="alert" aria-hidden="true">×</button></div><div class="alert alert-warning"> <strong class="default"><i class="fa fa-envelope-o"></i> Sam</strong> sent important mail. <button type="button" class="close" data-dismiss="alert" aria-hidden="true">×</button></div><div class="alert alert-danger"> <strong class="default"><i class="fa fa-hdd-o"></i> Server </strong> reported problems. <button type="button" class="close" data-dismiss="alert" aria-hidden="true">×</button></div><div class="alert alert-info nomargin"> <strong class="default"><i class="fa fa-money"></i> Received </strong> $1826 from client. <button type="button" class="close" data-dismiss="alert" aria-hidden="true">×</button></div></div></div></div>
           </div>
        );
    }
}

export default Notification;
